uniform float iTime;
uniform vec2 iResolution;
uniform vec4 iMouse;

// --- ASSETS ---
uniform sampler2D iChannel0; // Not used but required by spec
uniform sampler2D iChannel1; 

// --- STANDARD CONTROLS ---
uniform float u_speed;
uniform float u_camera_dist; // Used here for zoom
uniform float u_fov;
uniform float u_glow_intensity;

// --- VISUAL CONTROLS ---
uniform float u_turbulence_strength;
uniform float u_cloud_height;
uniform float u_color_shift;
uniform float u_density_factor;

out vec4 fragColor;

// --- LUMINA MATH LIB ---
#define PI 3.14159265359

mat2 rot(float a) {
    float s = sin(a), c = cos(a);
    return mat2(c, -s, s, c);
}

vec3 palette(float t) {
    vec3 a = vec3(0.5, 0.5, 0.5);
    vec3 b = vec3(0.5, 0.5, 0.5);
    vec3 c = vec3(1.0, 1.0, 1.0);
    vec3 d = vec3(0.263, 0.416, 0.557);
    return a + b * cos(6.28318 * (c * t + d));
}

// --- MAIN RENDER LOOP ---
void main() {
    // 1. Setup UVs and Ray Direction
    // Adapting the original "normalize(vec3(I+I,0) - iResolution.xyy)"
    // to Lumina standard UV space for consistent FOV control.
    vec2 uv = (gl_FragCoord.xy - 0.5 * iResolution.xy) / iResolution.y;
    vec3 rd = normalize(vec3(uv, -1.0 / u_fov)); // Negative Z to match original look

    // Animation Time
    float t = iTime * u_speed;

    // Raymarching Variables
    vec4 col = vec4(0.0);
    float dist = 0.0;
    float stepSize = 0.0;
    float density = 0.0;

    // Move ray origin slightly for zoom/camera_dist control
    // The original assumes RO = 0, so we just add to distance start
    dist = u_camera_dist; 

    // --- VOLUMETRIC MARCH ---
    for(int i = 0; i < 100; i++) {

        // Current Position along Ray
        vec3 p = dist * rd;

        // --- TURBULENCE LOOP (FBM) ---
        // Distorts the space to create cloud shapes
        // Iterates octaves of sine waves
        float scale = 5.0;
        for(int j = 0; j < 5; j++) {
            // "p.yzx" swizzles coords for 3D noise variation
            p += u_turbulence_strength * sin(p.yzx * scale - 0.2 * t) / scale;
            scale *= 2.0; // Double frequency every iteration
            if (scale > 200.0) break;
        }

        // --- DENSITY CALCULATION ---
        // "s" in original. Defines a horizontal slab of clouds.
        // abs(p.y) creates symmetry above/below horizon.
        // Positive values = inside cloud.
        float slab = u_cloud_height - abs(p.y);

        // Calculate Step Size
        // If inside cloud (slab > 0), small steps. Outside, large steps.
        // The original logic: max(slab, -slab * 0.2) / 4.0
        float stepFactor = max(slab, -slab * 0.2) / 4.0;
        stepSize = 0.005 + stepFactor;

        // Advance Ray
        dist += stepSize;

        // --- COLOR ACCUMULATION ---
        // Calculate base color pattern based on depth, x-pos, and time
        // Using cos() creates the rainbow banding
        float hue = slab / 0.07 + p.x + 0.5 * t;

        // Offset RGB channels for iridescence
        vec3 baseColor = cos(hue - vec3(3.0, 4.0, 5.0) + u_color_shift * 6.0) + 1.5;

        // Exponential density glow
        // The deeper inside the slab, the brighter it gets
        float glow = exp(slab / (0.1 / u_density_factor));

        // Accumulate
        // Divide by stepSize to normalize intensity vs step count
        col.rgb += baseColor * glow / stepSize * (u_glow_intensity * 0.00001);
    }

    // --- TONE MAPPING ---
    // The original accumulates massive values (e.g. 4e8), so we compress hard using tanh.
    // We squared the color in the original, here we adjust for our uniforms.
    vec3 finalCol = col.rgb * col.rgb;
    finalCol = tanh(finalCol); 

    fragColor = vec4(finalCol, 1.0);
}

